import React from "react";

function CitiesButton() {
  const cities = [
    {
      id: 1,
      title: "New York",
    },
    {
      id: 2,
      title: "India",
    },
    {
      id: 3,
      title: "Sydney",
    },
    {
      id: 4,
      title: "Tokyo",
    },
    {
      id: 5,
      title: "London",
    },
  ];

  return <div className="flex items-center justify-start">
    
    CitiesButton</div>;
}

export default CitiesButton;
